      category_photo:
        "https://d4p17acsd5wyj.cloudfront.net/shortcuts/specialty_foods.jpg",
    },
    {
      category_id: 4,
      category_name: "Japanese",
      category_photo:
        "https://d4p17acsd5wyj.cloudfront.net/shortcuts/cuisines/japanese.png",
